import React from 'react'

const Working = (props) => {
    console.log(content.size());
    for(var i=0;i<props.size();i++){
        if(i%2){
            return(
                <div className='container mt-5'>
    <div className="row flex-column-reverse flex-md-row">
      <div className="col-md-6 d-flex">
      <div className="text my-auto mx-auto">
        <h3 className='red'>{content[i].title}</h3>
        <h2 className='text-black lh-base'>{content[i].description}</h2>
        <h4 className='lh-base'>{content[i].result}</h4>
      </div>
      </div>
      <div className="col-md-6 d-flex justify-content-center">
        <img src="images/content.png " className="size img-fluid mx-auto" alt="Login" />
      </div>
    </div>
    </div>
            );
        }
        else{
            return(
                <div className='container mt-5'>
                <div className="row flex-column-reverse flex-md-row">
                <div className="col-md-6 d-flex justify-content-center">
                    <img src="images/login.png " className="size img-fluid " alt="Login" />
                  </div>
                  <div className="col-md-6 d-flex">
                  <div className="text my-auto">
                    <h3 className='red'>Create an account</h3>
                    <h2 className='text-black lh-base'>Create/login to an existing account to get started</h2>
                    <h4 className='lh-base'>An account is created with your email and a desired password</h4>
                  </div>
                  </div>
                </div>
                </div>
            );
        }
    }
//   return (
//     <>
//     <h2 className='text-black text-center'>How the app works</h2>
 
   
//     </>
    
//   )
}

export default Working;
